import React from 'react'
import {connect} from 'react-redux'
import { loadLeaderboardData } from '../actions/useraction'
import LeaderboardTable from './leaderboardTable';


class LeaderboardView extends React.Component{

    componentDidMount(){
        this.props.loadLeaderboardData(this.props.leaderboardName);
    }

    render(){
        var i =0;
        return(
            <div className={"leaderboard"}>

                <h2>Leaderboard : {this.props.leaderboardName}</h2>
                <div id={this.props.leaderboardName}>
                {
                (this.props.leaderboardData.leaderboardDetails != null) ?
                this.props.leaderboardData.leaderboardDetails[this.props.leaderboardName].subLeaderboards.map((lb)=>{
                    const players = this.props.leaderboardData.leaderboardDetails[this.props.leaderboardName].players[lb]
                    console.log(players)
                    return <LeaderboardTable key={lb} instance={lb} players={players} playerScores={this.props.leaderboardData.leaderboardDetails[this.props.leaderboardName].details}/>
                 }) : "Hi"
                }
                </div>

            </div>
        )
    }
}

const mapStateToProps = (state) => {
    return {
        leaderboardData : state.leaderboardsData
    }
}
export default connect(mapStateToProps,{loadLeaderboardData})(LeaderboardView);
